import React from "react";
import { useNavigate } from "react-router-dom";
function Success() {
  const navigate = useNavigate();
  return (
    <div>
      <h1>Success</h1>
      <button
        onClick={() => {
          navigate("/");
        }}
      >
        Back to Home
      </button>
    </div>
  );
}

export default Success;
